import React from 'react'
import Card from './Card'
const List = ({title,trailers}) => {
    return (
        <div className='px-8'>
            <h1 className='text-3xl text-white'>{title}</h1>
            <div>
                <div className='flex items-center'>
                {
    trailers.map((movie) => (
        <Card key={movie.id} />
    ))
}

                </div>
            </div>

        </div>
    )
}

export default List;
